import React from 'react'
import "./style.scss";
import gsap from 'gsap';
import {FaGithub} from 'react-icons/fa';
import {GrLinkedin,GrMail} from "react-icons/gr";
import {VscFileSubmodule, VscChecklist,VscAccount,VscArrowUp,VscFeedback,VscTriangleLeft,VscTriangleRight} from "react-icons/vsc";



export default function Navbar() {

    const content = document.getElementById("menu-btns");

    var tl = gsap.timeline({defaults: {ease:"power2.inOut"}});
    var toggle = false;
    tl.to(".menu-btns",
    {background: gray})
    

    function slideOpen() {
        gsap.to(content,{x:65})
    }

    function slideClose() {
        gsap.to(content,{x:0})
    }
    
    return (
        <div className="navbar" data-scroll-section>
            <div id="menu">
                Menu
                <ul class="menu-btns">
                    <li><VscArrowUp/></li>
                    <li><VscAccount/></li>
                    <li><VscChecklist/></li>
                    <li><VscFileSubmodule/></li>
                    <li><VscFeedback/></li>
                </ul>
            </div>
            <div id="icons">
                <a href="https://github.com/joicejoseph3198" target="_blank" rel="noopener noreferrer"><FaGithub id="git"/></a>
                <a href="https://www.linkedin.com/in/joice-v-joseph-85311a1a1/" target="_blank" rel="noopener noreferrer"><GrLinkedin id="linkd"/></a>
                <a href="your link here" target="_blank" rel="noopener noreferrer"><GrMail id="mail"/></a>
            </div>
        </div>
    )
}
